  \"2016-11-25T21:06:26.576547\",\n\t\"name\": \"2010-national-assessment-of-educational-progress\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The National Assessment of Educational Progress,
  2010 (NAEP 2010), is part of the National Assessment of Educational Progress (NAEP)
  program; program data available since 1971 at <http://nces.ed.gov/nationsreportcard/naepdata/>.
  NAEP (http://nces.ed.gov/nationsreportcard/) is a cross-sectional survey that assesses
  what America's students know and can do in various subject areas. The 2010 study
  was conducted using a computer-based assessment of students. Students in grades
  4, 8, and 12 were sampled. NAEP 2010 assessments consist of national and state assessments
  in geography, civics, U.S. history, and writing. The studyufffds response rates
  were between 83 and 96 percent. Key statistics produced from NAEP 2010 are results
  on subject-matter achievement, instructional experiences, and school environment
  for populations of students (e.g., all fourth-graders) and groups within those populations
  (e.g. female students, Hispanic students).\",\n\t\"license_title\": \"Creative Commons
